import React from 'react';

const defaultUser = {
  email: '',
  password: '',
  isLoggedIn: false,
};

const defaultLogOut = () => { };

const AppContext = React.createContext({
  user: defaultUser,
  logOut: defaultLogOut,
});

export { defaultUser, defaultLogOut, AppContext };
